import React, { useState, useEffect } from 'react';
import '../styles/centro.css';

const Centro = () => {
    const [equipoDirectivo, setEquipoDirectivo] = useState([]);

    useEffect(() => {
        // Lógica para obtener la lista de miembros del equipo directivo (puedes hacer una solicitud al backend aquí)
        const obtenerEquipoDirectivo = async () => {
            try {
                const response = await fetch('http://localhost:5000/equipodirectivo');
                if (response.ok) {
                    const data = await response.json();
                    setEquipoDirectivo(data);
                } else {
                    console.error('Error al obtener la lista de miembros del equipo directivo');
                }
            } catch (error) {
                console.error('Error al obtener la lista de miembros del equipo directivo:', error);
            }
        };

        obtenerEquipoDirectivo();
    }, []);

    return (
        <div>
            {/* Equipo Directivo */}
            <div className="container-fluid fondo">
                <h1 className="pt-5 text-center color-titulo">Equipo directivo</h1>
                <div className="row pb-5 justify-content-center align-items-center py-5 mx-auto">
                    {equipoDirectivo.map((miembro) => (
                        <React.Fragment key={miembro.id}>
                            <div className="col-md-4 text-center text-md-end px-5 pb-3">
                                <img
                                    src={`data:image/jpeg;base64,${miembro.foto.toString('base64')}`}
                                    alt={miembro.nombre}
                                    className="directora-imagen"
                                />
                            </div>
                            <div className="col-md-8 text-center text-md-start px-5 pb-3">
                                <h2 className="directora-nombre">{miembro.nombre} ({miembro.puesto})</h2>
                            </div>
                        </React.Fragment>
                    ))}
                </div>
            </div>

            {/* Instalaciones */}
            <div className="text-center fondo">
                <hr />
                <div className="container">
                    <h1 className="pt-5 color-titulo">Instalaciones</h1>
                    <div className="texto-instalaciones py-5">
                        <p className="px-5 text-start mb-5">
                            El centro educativo cuenta con un total de X aulas, X laboratorios, una sala de música y diversas
                            instalaciones deportivas.
                            En estas instalaciones, el cuerpo docente ofrece sus asignaturas con un amplio conjunto de recursos
                            y el equipamiento más avanzado disponible,
                            garantizando así un entorno óptimo para la enseñanza
                        </p>
                        <div id="carouselExample" className="carousel slide" data-bs-ride="carousel" data-bs-interval="5000">
                            <div className="carousel-inner">
                                <div className="carousel-item active">
                                    <img src={process.env.PUBLIC_URL + '/images/instituto.jpeg'} className="img-fluid img-instalaciones" alt="Pistas Deportivas" />
                                    <p className="pt-3">Pistas Deportivas</p>
                                </div>
                                <div className="carousel-item">
                                    <img src={process.env.PUBLIC_URL + '/images/musica.jpg'} className="img-fluid img-instalaciones" alt="Aula de música" />
                                    <p className="pt-3">Aula de música</p>
                                </div>
                                <div className="carousel-item">
                                    <img src={process.env.PUBLIC_URL + '/images/laboratorio.jpg'} className="img-fluid img-instalaciones" alt="Laboratorio" />
                                    <p className="pt-3">Laboratorio</p>
                                </div>
                            </div>
                            <a className="carousel-control-prev" href="#carouselExample" role="button" data-bs-slide="prev">
                                <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                                <span className="visually-hidden">Anterior</span>
                            </a>
                            <a className="carousel-control-next" href="#carouselExample" role="button" data-bs-slide="next">
                                <span className="carousel-control-next-icon" aria-hidden="true"></span>
                                <span className="visually-hidden">Siguiente</span>
                            </a>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Centro;
